function Input({ label, value, onChange, placeholder }) {
    return (
      <div style={{ marginBottom: '10px' }}>
        <label>{label}</label><br />
        <input
          value={value}
          onChange={onChange}
          placeholder={placeholder}
          style={{ padding: '6px', width: '250px' }}
        />
      </div>
    );
  }
  
  export default Input;
